import img_facebook from "../../img/facebook.svg";
import img_vk from "../../img/vkontakte-blue-square-logo-15988.svg";
import RoundKnob from "../RoundKnobL";

function FB_VK() {
  return (
    <div className="fc_vk">
      <RoundKnob>
        <>VK</>
      </RoundKnob>
      <pre> </pre>
      <RoundKnob>
        <img className="facebook" src={img_vk} />
      </RoundKnob>
    </div>
  );
}

export default FB_VK;
